class StartsEndsWithTestCase(TestCase):
    def test_starts_ends_with(self):
        self._insert_raw_data()
        _q = RawData.objects.filter(job_id='46c4feac-a2e3-44da-b79d-2d27925b7a5e', domain='canadiantire.ca', http_status__lt=400)
        for _base_raw in _q.filter(url__regex=settings.CANADIANTIRE_CA_ITEM_LINK_PATTERN):
            _parent_sku = utils.extract_sku_from_url(url=_base_raw.url, domain='canadiantire.ca')
            _store_raw = _q.get(url__startswith=settings.CANADIANTIRE_CA_API_STORES_LINK, url__endswith='#{}'.format(_parent_sku))
            self.assertEqual(_parent_sku, '0711063P')
            self.assertEqual(_store_raw.job_id, '46c4feac-a2e3-44da-b79d-2d27925b7a5e')

