    def test_build_walmart_com_item_price(self):
        bip = BuildItemPrice(raw_data=self.WALMART_COM_RAW_DATA_1)
        item = bip.get_item()
        item_price = bip.get_item_price()

        # assert item
        self.assertEqual(item.domain, 'walmart.com')
        self.assertEqual(item.sku, '55432568')
        self.assertEqual(item.upc, '045496590420')
        self.assertEqual(item.title, 'The Legend of Zelda: Breath of the Wild, Nintendo, Nintendo Switch, 045496590420')
        self.assertEqual(item.brand_name, 'Nintendo of America')
        self.assertEqual(item.picture_url, 'https://i5.walmartimages.com/asr/85ff2df1-452c-45ff-9e4d-639183854963_1.1870b197ea4df36fbc18aa5b2c3e7415.jpeg')
        self.assertEqual(item.meta_title, 'The Legend of Zelda: Breath of the Wild, Nintendo, Nintendo Switch, 045496590420 - Walmart.com')
        self.assertEqual(item.meta_description, 'Free 2-day shipping. Buy The Legend of Zelda: Breath of the Wild, Nintendo, Nintendo Switch, 045496590420 at Walmart.com')
        self.assertEqual(item.meta_image, 'https://i5.walmartimages.com/asr/88fdeff7-b5c7-4dc1-9d30-66217f20f86c.3d08635afa4636f1074ae99ebf602b92.jpeg')

        #assert item price
        self.assertEqual(item_price.domain, 'walmart.com')
        self.assertEqual(item_price.sku, '55432568')
        self.assertEqual(item_price.price, 54.99)
        self.assertEqual(item_price.original_price, 59.99)
        self.assertEqual(item_price.online_availability, ItemPrice.ITEM_PRICE_AVAILABILITY_IN_STOCK)
        self.assertEqual(item_price.online_urgent_quantity, None)
        self.assertEqual(len(item_price.store_availabilities), 5)
        self.assertEqual(item_price.store_availabilities[2]['store_id'], '5027')
        self.assertEqual(item_price.store_availabilities[2]['store_name'], 'Lancaster Supercenter')
        self.assertEqual(item_price.store_availabilities[2]['store_address'], '4975 Transit Rd')
