class BuildWalmartCaItemPriceTestCase(TestCase):

    def test_build_walmart_ca_item_price(self):
        bip = BuildWalmartCaItemPrice(raw_data=self._build_raw_data(),
                                    price_raw_data=self._build_price_raw_data(),
                                    stores_raw_data=self._build_stores_raw_data())
        items = bip.get_items()
        item_prices = bip.get_item_prices()

        # assert items
        self.assertEqual(len(items), 10)
        self.assertEqual(items[0].domain, 'walmart.ca')
        self.assertEqual(items[0].sku, '6000197307618')
        self.assertEqual(items[0].upc, '5818510180')
        self.assertEqual(items[0].title, "Athletic Works Women's Seamless Camibra with Keyhole in The Back")
        self.assertEqual(items[0].brand_name, 'Athletic Works')
        self.assertEqual(items[0].picture_url, 'https://i5.walmartimages.ca/images/Large/gre/y_f/999999-AWY81600LD_LT-GREY_F.jpg')
        self.assertEqual(items[0].meta_title, "Athletic Works Women's Seamless Camibra with Keyhole in The Back | Walmart Canada")
        self.assertEqual(items[0].meta_description, "Buy Athletic Works Women's Seamless Camibra with Keyhole in The Back from Walmart Canada. Shop for more Bras available online at Walmart.ca")
        self.assertEqual(items[0].meta_image, 'https://i5.walmartimages.ca/images/Large/952/531/6000199952531.jpg')

        # assert item prices
        self.assertEqual(len(item_prices), 10)
        self.assertEqual(item_prices[4].domain, 'walmart.ca')
        self.assertEqual(item_prices[4].sku, '6000197308534')
        self.assertEqual(item_prices[4].price, 15)
        self.assertEqual(item_prices[4].original_price, 15)
        self.assertEqual(item_prices[4].online_availability, ItemPrice.ITEM_PRICE_AVAILABILITY_IN_STOCK)
        self.assertEqual(item_prices[4].online_urgent_quantity, 2)
        self.assertEqual(len(item_prices[4].store_availabilities), 3)
        self.assertEqual(item_prices[4].store_availabilities[1]['store_id'], '3159')
        self.assertEqual(item_prices[4].store_availabilities[1]['store_name'], 'Scarborough West Supercentre')
        self.assertEqual(item_prices[4].store_availabilities[1]['store_address'], 'Eglinton Ave & Pharmacy Ave')
        self.assertEqual(item_prices[4].store_availabilities[1]['store_city'], None)
        self.assertEqual(item_prices[4].store_availabilities[1]['store_state_or_province'], None)
        self.assertEqual(item_prices[4].store_availabilities[1]['store_postal_code'], None)
        self.assertEqual(item_prices[4].store_availabilities[1]['store_phone'], None)
        self.assertEqual(item_prices[4].store_availabilities[1]['store_availability'], ItemPrice.ITEM_PRICE_AVAILABILITY_OUT_OF_STOCK)
        self.assertEqual(item_prices[4].store_availabilities[1]['store_urgent_quantity'], None)
        self.assertEqual(item_prices[4].store_availabilities[2]['store_id'], '1150')
        self.assertEqual(item_prices[4].store_availabilities[2]['store_availability'], ItemPrice.ITEM_PRICE_AVAILABILITY_OUT_OF_STOCK)
        self.assertEqual(item_prices[4].store_availabilities[2]['store_urgent_quantity'], None)
        self.assertEqual(item_prices[4].job_id, 'fb54168c-2c86-4c93-9b36-7f2185038f1f')


