class BuildCanadiantireCaItemPriceTestCase(TestCase):

    def test_build_canadiantire_ca_item_price(self):
        bip = BuildCanadiantireCaItemPrice(raw_data=self._build_raw_data(),
                                    store_raw_data=self._build_store_raw_data(),
                                    price_raw_data=self._build_price_raw_data())
        items = bip.get_items()
        item_prices = bip.get_item_prices()

        # assert items
        self.assertEqual(len(items), 5)
        self.assertEqual(items[3].domain, 'canadiantire.ca')
        self.assertEqual(items[3].sku, '1871458')
